import React, {useState} from "react";
import "./Home.css";
import Card from "../components/Card";

function Home(){

    const [test, setTest] = useState([{
        title: "GATE Test",
        description: "This is whatever. App provides simple mathematical functions in a beautifully designed interface." +
            "It performs basic calculations such as addition, subtraction, multiplication, and division.",
        url: require("../images/gate.png")
    },{
        title: "Jee Advance",
        description: "App provides simple mathematical functions in a beautifully designed interface." +
            "It performs basic calculations such as addition, subtraction, multiplication, and division.",
        url: require("../images/jee.webp")
    },{
        title: "CAT Test",
        description: "App provides simple mathematical functions in a beautifully designed interface." +
            "It performs basic calculations such as addition, subtraction, multiplication, and division.",
        url: require("../images/cat.jpeg")
    }
    ]);

    return (

        <div className="home">
            <img className="home__image"
                 src={require("../images/banner.jpg")}
                 alt="" />

            <div className="home__row">
                {
                    test.map((info, i) =>{
                       return(
                           <Card src={info.url}
                                 description={info.description}
                                 title={info.title}
                                 id={i}
                           />
                       )
                    })
                }
            </div>

        </div>

    );
}

export default Home;
